apiVersion: camel.apache.org/v1alpha1
kind: Kamelet
metadata:
  name: jms-source-apache-artemis
  annotations:
    camel.apache.org/kamelet.icon: "data:image/png;base64,"
    camel.apache.org/kamelet.support.level: "Preview"
    camel.apache.org/provider: "Apache Software Foundation"
    camel.apache.org/catalog.version: "main-SNAPSHOT"
    camel.apache.org/kamelet.group: "JMS"
  labels:
    camel.apache.org/kamelet.type: "source"
spec:
  definition:
    title: "JMS - Apache Artemis JMS Kamelet"
    description: "A Kamelet that can consume events from an Apache Artemis message broker using JMS"
    required:
      - destinationName
      - brokerURL
    type: object
    properties:
      destinationType:
        title: "Destination Type"
        description: "The JMS destination type (i.e.: queue or topic)"
        type: string
        default: queue
      destinationName:
        title: "Destination Name"
        description: "The JMS destination name"
        type: string
      brokerURL:
        title: "Broker URL"
        description: "The JMS URL"
        type: string
  dependencies:
  - "camel:jms"
  - "camel:kamelet"
  - "mvn:org.apache.activemq:artemis-jms-client-all:2.17.0"
  flow:
    beans:
      - name: connectionFactoryBean
        type: "#class:org.apache.activemq.artemis.jms.client.ActiveMQConnectionFactory"
        property:
          - key: brokerURL
            value: '{{brokerURL}}'
    from:
      uri: "kamelet-reify:jms:{{destinationType}}:{{destinationName}}"
      parameters:
        connectionFactory: "#bean:{{connectionFactoryBean}}"
      steps:
      - to:
          uri: "kamelet:sink"
